import React from 'react';
import { Box, Typography, Container, Grid, IconButton, Link } from '@mui/material';
import { styled, useTheme } from '@mui/material/styles';
import InstagramIcon from '@mui/icons-material/Instagram';
import WhatsAppIcon from '@mui/icons-material/WhatsApp';
import BannerImage from '../assets/bannerr.svg';

const AboutContainer = styled(Box)(({ theme }) => ({
  position: 'relative',
  padding: '80px 20px',
  background: 'linear-gradient(180deg, #f5f5f5 80%, #e9e6e1 100%)',
  overflow: 'hidden',
}));

const AuraWrapper = styled('div')({
  position: 'relative',
  width: 380,
  height: 380,
  margin: '0 auto',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
});

const AuraCircle = styled('div')({
  position: 'absolute',
  width: 380,
  height: 380,
  borderRadius: '50%',
  background: '#f5f5f5',
  boxShadow: '0 8px 32px rgba(86,101,66,0.10)',
  zIndex: 1,
});

const DecorativeCurve = styled('div')({
  position: 'absolute',
  left: -40,
  bottom: -30,
  width: 420,
  height: 120,
  zIndex: 0,
  pointerEvents: 'none',
});

const ProfileImage = styled('img')({
  width: 320,
  height: 320,
  objectFit: 'cover',
  borderRadius: '50%',
  boxShadow: '0 8px 32px rgba(86,101,66,0.18)',
  background: 'none',
  display: 'block',
  margin: '0 auto',
  position: 'relative',
  zIndex: 2,
});

const SocialIcons = styled('div')({
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  gap: 18,
  margin: '16px 0 0 0',
});

const AboutText = styled('div')({
  maxWidth: 700,
  margin: '0 auto',
  textAlign: 'left',
  fontSize: 18,
  lineHeight: 1.6,
  color: '#222',
  marginTop: 24,
});

const About = () => {
  const theme = useTheme();
  return (
    <AboutContainer id="about" sx={{ background: `linear-gradient(180deg, ${theme.palette.background.default} 80%, ${theme.palette.background.paper} 100%)` }}>
      <svg viewBox="0 0 1440 80" width="100%" height="80" style={{ display: 'block', position: 'absolute', top: 0, left: 0, zIndex: 1 }} xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="none">
        <path d="M0,80 C480,0 960,160 1440,80 L1440,0 L0,0 Z" fill={theme.palette.background.default} />
      </svg>
      <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
        <Grid container spacing={6} alignItems="center" justifyContent="center">
          <Grid item xs={12} md={5} sx={{ position: 'relative' }}>
            <AuraWrapper>
              <AuraCircle />
              <DecorativeCurve>
                <svg width="100%" height="100%" viewBox="0 0 420 120" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M0,100 Q210,0 420,100" stroke={theme.palette.background.paper} strokeWidth="18" fill="none" />
                </svg>
              </DecorativeCurve>
              <ProfileImage src={BannerImage} alt="Psicólogo Cristian Hendler" />
            </AuraWrapper>
          </Grid>
          <Grid item xs={12} md={7}>
            <Box sx={{ textAlign: 'center', mb: 2 }}>
              <Typography variant="h4" component="h2" sx={{ color: theme.palette.text.primary, fontWeight: 700 }} gutterBottom>
                Psicólogo Cristian Hendler
              </Typography>
              <Typography sx={{ color: '#a97c50', fontWeight: 600, fontSize: 24, mb: 1 }}>
                CRP 07/42111
              </Typography>
              <SocialIcons>
                <a
                  href="https://www.instagram.com/psicocrishendler/"
                  target="_blank"
                  rel="noopener noreferrer"
                  style={{ color: theme.palette.primary.main, fontSize: 30, transition: 'color 0.2s' }}
                  onMouseOver={e => (e.currentTarget.style.color = theme.palette.primary.dark)}
                  onMouseOut={e => (e.currentTarget.style.color = theme.palette.primary.main)}
                  aria-label="Instagram"
                >
                  <InstagramIcon fontSize="inherit" />
                </a>
                <a
                  href="https://wa.me/5551996024420"
                  target="_blank"
                  rel="noopener noreferrer"
                  style={{ color: theme.palette.primary.main, fontSize: 30, transition: 'color 0.2s' }}
                  onMouseOver={e => (e.currentTarget.style.color = theme.palette.primary.dark)}
                  onMouseOut={e => (e.currentTarget.style.color = theme.palette.primary.main)}
                  aria-label="WhatsApp"
                >
                  <WhatsAppIcon fontSize="inherit" />
                </a>
              </SocialIcons>
            </Box>
            <AboutText sx={{ color: theme.palette.text.primary }}>
              <p>Sou Psicólogo Clínico formado pela Universidade Luterana do Brasil (ULBRA) - Torres/RS, com registro no Conselho Regional de Psicologia do Rio Grande do Sul (CRP 07/42111).</p>
              <p>Atuo na área clínica, oferecendo atendimento psicológico individual para adultos, adolescentes e crianças, com foco em questões emocionais, comportamentais e desenvolvimento pessoal.</p>
              <p>Ofereço um espaço seguro e acolhedor para que você possa explorar suas questões emocionais, desenvolver autoconhecimento e estratégias para lidar com os desafios da vida.</p>
              <p>Especialista em atendimento presencial em Torres/RS e online para todo o Brasil e brasileiros no exterior.</p>
            </AboutText>
          </Grid>
        </Grid>
      </Container>
    </AboutContainer>
  );
};

export default About;
